たった1分で愛車を小悪魔系に!!あなたの愛車は注目度No.1間違いなし！<br>雨にも風にも負けない超最先端オシャレエンブレムステッカー、さらに両面テープが付いたステッカーのため、どのエンブレムにもマッチします♪<br><br>素材<br>・メタルタイプ<br><br>カラー<br>・レッド<br>・ブラック<br>・シルバー<br>・ゴールド<br><br>※貼り付けの際の注意事項<br>貼り付ける場所をきれいに拭きとってください。（アルコールなどで脂分を取り除くと剥がれにくくなります）<br><br>※注意※<br>本商品にはエンブレムは付属されておりません。<br><br></DIV>
